import React from 'react';
import { Routes, Route } from 'react-router-dom';

import './App.css';

import Pages from './pages/index';

function App() {
  return (
      <Routes>
        <Route exact path="/valentine" element={<Pages title="Happy Valentine's Day" />} />
      </Routes>
  );
}

export default App;
